insert  into `play`(`play_id`,`play_type_id`,`play_lang_id`,`play_name`,`play_introduction`,`play_image`,`play_length`,`play_ticket_price`,`play_status`) values (1,11,16,'魔兽','艾泽拉斯与德拉诺本是两颗祥和安宁的星球，人类在艾泽拉斯大陆上世代繁衍生息，兽人则在德拉诺的土地上辛勤耕耘。直到兽人古尔丹（吴彦祖 饰）的出现，打破了两个星球的和平。邪恶的古尔丹为了一己私利，使用恶魔能量打开了一扇传送门——黑暗之门，并残忍的破坏兽人的家园，将原本爱好和平的兽人变成一个个野蛮残暴的战士，迫使他们穿过黑暗之门到达人类的领地作恶。',NULL,124,'223.00',0),(7,6,6,'电锯惊魂','非常恐怖',NULL,2,'998.00',0),(8,5,16,'两只老虎','欢乐喜剧',NULL,2,'999.00',0),(9,10,10,'倚天屠龙记','武侠',NULL,2,'345.00',0),(10,9,9,'三体','科幻大片',NULL,3,'567.00',0),(11,9,9,'摩天大楼','科幻大片',NULL,3,'123.00',0),(12,5,5,'1222','《。大苏打',NULL,12,'3.00',0),(13,6,6,'12','12',NULL,12,'12.00',12);

